import React from "react";
import { useParams } from 'react-router-dom';
import { packageimage } from "../InstamartJson";
import './Home.css';


function Rental() {
  const { rentalid } = useParams();

  const temp = packageimage.find((ele) => ele.id === rentalid)
  return (
    <div>
      <h2>Rental</h2>
      <img src={temp.src} alt="a" />
      <ul>
        <li>
          <p>{temp.package}</p>
          <p>{temp.amount}</p>
          <p>expired on:{temp.expiry}</p>
          <button>RENEW</button> <button>SCHEDULE PICKUP</button>
        </li>
      </ul>
    </div>
  );
}

export default Rental;
